import { Component } from '@angular/core';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css']
})
export class DashboardComponent {
  activeComponent: 'highscore' | 'question' = 'highscore';
}
<app-header admNav1 = "Questions" admNav2 = "Highscore" admNav3 = "Category" [logOutBtn] = "true"></app-header>

<app-category-highscore-page></app-category-highscore-page>
